import React, { Component } from 'react';
import './footer.css';

export default class Footer extends Component {
    render() {
        return (
            <footer className="footer bg-dark">
                <div className="container"><p className="author-test">By Oscar Bello</p></div>
            </footer>
        );
    }
}
